import React from "react";
import "./navbar.css";
import axios from 'axios';

const Navbar = () => {

   const getData = async () =>{
    const response = await axios.get("https://reqres.in/api/users?page=1");
    console.log(response);
   }

  return (
    <div id="navbar">
      <button onClick={getData}>Get Users</button>
    </div>
  );
};

export default Navbar;
